import React from 'react';
import uuid from 'uuid';
import { useQuery, useMutation, useSubscription } from "@apollo/react-hooks";

export class empresaitem extends React.Component {


  render() {

    const datos= this.props.variables;

    return (
      <tr key={uuid()}>
        <th key={datos._id} className="text-right">
          {datos.nombre}
        </th>

        <th key={datos._id} className="text-right">
          {datos.correo}
        </th>

        <th key={datos._id} className="text-right">
          {datos.canton}
        </th>

        <th key={datos._id} className="text-right">
          {datos.provincia}
        </th>
      </tr>
    );
  };
};

export default empresaitem;
